import React from 'react'
import SimpleImageSlider from "react-simple-image-slider";


const sliderImages = [
    {
       url: "https://img.freepik.com/premium-psd/horizontal-website-banne_451189-110.jpg"
    },
    {
      url:"https://img.freepik.com/premium-psd/horizontal-web-banner-with-laptop-laptop-mockup_451189-71.jpg"
    } 

  ]

function UnivAlum() {
  return (
    <div>
        <h1>University Alum Represent</h1>
        <SimpleImageSlider
        width={140}
        height={250}
        images={sliderImages}
        showNavs={true}
        showBullets={true}
        autoPlay={true} 
        />

    </div>
  )
}

export default UnivAlum
